import { MainText, PositionText } from './Main.style'

import { useTypewriter} from 'react-simple-typewriter'

function Main() {

    const {text} = useTypewriter({
        words: ['Hello', 'From', 'Typewriter', 'Hook!'],
        loop: true // Infinit
      })
  return (
    <>
        <MainText>
            <h5>Reza Agung Prasetya</h5>
            <PositionText>{text}</PositionText>
            <p>Knack of building</p>
            <span>{text}</span>
        </MainText>
    </>
  )
}

export default Main
